import React from 'react';

const GuessList = ({ guesses }) => {
  return (
    <div>
      {guesses.map((guess, index) => (
        <div key={index}>
          <span>{guess.word}</span> - <span>{guess.result}</span>
        </div>
      ))}
    </div>
  );
};

export default GuessList;
